scovery location, Vol 1, A - N.\\n\\nAnvil of Old Orsinium- Old Orsinium, Wrothgar\\nAshen Infernace Gate- Stonefalls\\nAyleid Lightwell- Betnikh\\nBeacon of Tower Zero- Stormhaven\\nBranch of Falinesti- Greenshade\\nBrazier of Frozen Flame- Bleak Rock Isle\\nCarved Whale Totem- The Rift, Skyrim\\nCat\\'s Eye Prism- Khenarthi\\'s Roost\\nCoil of Satakal- Alik\\'r\\nDaedric Pillar of Torment- Coldharbour\\nThe Dutiful Guar- Bal Foyen\\nDwarven Puzzle Box- Stros M\\'Kai\\nDwemer Star Chart- Stros M\\'Kai\\nEbony Fox Totem- The Rift, Skyrim\\nEchoes of Aldmeris- Auridon\\nEight Star Chandelier- Grahtwood\\nFont of Auri-El- Blackreach\\nGolden Idol of Morihaus- Gold Coast\\nGreensong Gathering Circle- Greenshade\\nThe Heartland- Cyrodiil\\nJeweled Skull of Ayeleid Kings- Glenumbra\\nKingmaker\\'s Trove- Glenumbra\\nMoarmeri Serpent Shrine- Auridon\\nMnemonic Star Sphere- Clockwork City\\nMoonlight Mirror- Reaper\\'s March\\nMoons-Blessed Ceremonial Pool- Southern Elsweyr\\nMoth Priest\\'s Cleansing Bowl- Northern Elsweyr\\nNest of Shadows- Arx Corinium, Shadowfen\\nNisswo\\'s Soul Tender- Murkmire\\nNoble Knight\\'s Rest- Stormhaven',},['SizeY']=58,},[22]={['Roll']=0,['Pitch']=4.625123,['Y']=29980,['SizeZ']=58,['Id']=4239,['SizeX']=46.456456,['EffectType']=8503,['Alpha']=1,['Groups']=0,['Yaw']=2.340487,['Color']=83153,['X']=161084,['Z']=167421,['Contrast']=2.320000,['MetaData']={['title']='College of Antiquarians - Catalog Vol 2',['message']='Gabrielle Benele, 2E 583\\nA listing of the antiquities held by the College of Antiquarians of Western Skyrim, and the discovery location, Vol 2, P-Z. \\n\\nPrismatic Sunbird Feather- Summerset\\nRemnant of the False Tower- Rivenspire\\nRiven King\\'s Throne- Rivenspire\\nRuby Dragon Skull- Bleak Rock Isle\\nRune Carved Mammoth Skull- The Rift, Skyrim\\nSacred Chalice of Ysgramor (2)- Eastmarch, Skyrim\\nSeat of the Snow Price (4)- Hjaalmarch, Skyrim\\nShrine of Boethra- Southern Elsweyr\\nSilvenari Sap Stone- Malabal Tor\\nSixth House Ritual Table- Vvardenfell\\nSpellscar Shard- Craglorn\\nStained Glass of Lunar Phases (2)- Northern Elsweyr\\nSweet Khenarthi\\'s Song- Khenarthi\\'s Roost\\nTall Papa\\'s Lamp- Bangkorai\\nTri-Angled Truth Altar- Bal Foyen\\nTusks of the Orc Father- Wrothgar\\nVoid Crystal Anomaly- Coldharbour\\nWarcaller\\'s Painted Drum- Bethnikh\\nYokudan Skystone Scabbard- Hew\\'s Bane ',},['SizeY']=58,},[23]={['Roll']=0,['Pitch']=4.799655,['Y']=29574,['SizeZ']=30,['Id']=4240,['SizeX']=26.456456,['EffectType']=8502,['Alpha']=1,['Groups']=0,['Yaw']=5.804965,['Color']=154585,['X']=162181,['Z']=165057,['Contrast']=1.750000,['MetaData']={['title']='Antiquities of Reaper\\'s March',['message']='The following is a complete listing of artifacts catalogued by associates of  the confederated societies of Antiquarians, found in or rumored to be located in Reaper\\'s March.\\n\\nAncestral High Elf Legs- a tome of ancient crafting techniques\\n\\nTwo Moons Censer- a typical style of incense burner found in the region\\n\\nHunt-Lord\\'s Djerid- Antique throwing spear, moderately valuable\\n \\nAncestral High Elf Shields- a tome of crafting techniques\\n\\nMane\\'s Frayed Crown- Antique crown typical of those worn by the Khajiti leaders referred to as The Mane. Highly valuable.\\n\\nShocklancer Consuscnciteeitnss iasisnao (this area is smudged with what appears to be brown gravy)\\n\\nMalacath\\'s Brutal Ritual Dust- a fragment of the mythic ring \"Malacath\\'s Band of Brutality\"\\n\\nMoonlight Mirror-  An unusual mirror, framed gorgeously, the moons dominate the mirror, making it more for gazing at than into.\\n\\n\\n\\nLOST:\\n\\nSorcerer King\\'s Blade- A broken blade once wielded by an Ayleid ruler who held mastery over great magic. ',},['SizeY']=30,},[24]={['Roll']=0,['Pitch']=4.712564,['Y']=29950,['SizeZ']=30,['Id']=4241,['SizeX']=26.456456,['EffectType']=8502,['Alpha']=1,['Groups']=0,['Yaw']=1.591740,['Color']=633924,['X']=161543,['Z']=166945,['Contrast']=3.500000,['MetaData']={['title']='Journal of Reginus Buca, Grahtwood, 2E 580-581',['message']='Notes on antiquities of the Grahtwood.\\nReginus Buca, Antiquarian, 2E 580-581\\n\\nRain\\'s Hand 20, a Bosmer Hunting Horn- Sounding a horn to commence a hunt? I doubt it. The last thing a Wood Elf would do is announce the beginning of a hunt to the whole forest. Nor do the Bosmer use the Wild Hunt for mere decoration. No, this horn is blown to signal the end of the hunt.\\n\\nMid Year 16, Ayleid Statuette- Interesting. This gold statuette appears to be a representation of the Daedric Prince Meridia--the personification of the element of light, at least to the Ayleids. A small sculpture such as this probably resided in a noble\\'s house shrine.\\n\\nSun\\'s Height 3, Eight-Star Chandelier- Take note of the number of sconces in the chandelier--eight welkynd stones in all to honor the Eight Divines. This lends credence to my theory that Elven numerology played a role in Ayleid civilization, just as it does in modern High Elf culture.\\n\\nSun\\'s Height 25, Preserved Music Box Mechanism- Despite the object\\'s age, the miniscule aspects of this music box seem to be in perfect working order. We should take care when handling it, though. Amalien, please resist the urge to take it apart.\\n\\nLast Seed 24- Statue of Ste. Alessia Paravant- I suspect this is a Bretonic work--perhaps given to Hestra as a gift after High Rock\\'s admission to the Empire. As you know, the Alessian Order placed tight restrictions on graven images of Alessia. We\\'ll likely never know what she really looked like.\\n',},['SizeY']=30,},[25]={['Roll']=0,['Pitch']=4.712564,['Y']=29978,['SizeZ']=30,['Id']=4242,['SizeX']=26.456456,['EffectType']=8501,['Alpha']=1,['Groups']=0,['Yaw']=3.296927,['Color']=20059,['X']=161376,['Z']=167473,['Contrast']=1,['MetaData']={['title']='Lost Antiquities of Tamriel',['message']='A listing of antiquities sought by the College of Antiquarians, and leads or probable location.\\n\\nAltar of Celestial Convergence, rumored to be lost in Craglorn.\\n\\nBlessed Dais of Almalexia, assumed to be lost in some Dunmeri region\\n\\nMeridian Sconce, a lead is said to be found in the Depths of Malatar, Gold Coast. Recruiting adventurers to locate.\\n\\nStatue of St. Alessia Paravant- Probably in Grahtwood. No strong lead.\\n\\nMorwha\\'s Blessing statue- Rumors suggest the Thieve\\'s Guild of Hew\\'s Bane knows of this antiquity\\'s location. Consider an alliance or trade.\\n\\nHollowbone Wind Chimes- Somewhere in Malabal Tor. Low priority.\\n\\nSorcerer King\\'s Blade- Highly sought after. Reaper\\'s March.\\n\\nBust of St. Nerevar, Moon-and-Star. Likely in Vvardenfell.',},['SizeY']=30,},[26]={['Roll']=0,['Pitch']=0,['Y']=30007,['SizeZ']=25,['Id']=4243,['SizeX']=143,['EffectType']=4405,['Alpha']=1,['Groups']=0,['Yaw']=4.738569,['Color']=999999,['X']=162078,['Z']=166995,['Contrast']=1,['MetaData']={['message']='THIS IS NOT YOUR PERSONAL WASH BASIN!!\\nTHANK YOU FOR NOT SOILING THIS PRICELESS\\n  ANTIQUITY WITH YOUR GRUBBY FINGERS.',},['SizeY']=25,},[27]={['Roll']=0,['Pitch']=0,['Y']=30651,['SizeZ']=10,['Id']=4244,['SizeX']=6.456456,['EffectType']=8501,['Alpha']=1,['Groups']=0,['Yaw']=1.534144,['Color']=102439,['X']=162358,['Z']=166087,['Contrast']=1,['MetaData']={['title']='a request to my tormenters',['message']='Whoever keeps putting my name on pieces of paper and throwing them into the Brazier of Frozen Flame-\\n\\nPLEASE STOP\\n\\nThis isn\\'t funny anymore.\\n\\n-Harald',},['SizeY']=10,},},['HouseId']=81,['Version']='15.7.9',['World']='na',},[7]={['TS']=1611277155,['Effects']={[1]={['Roll']=0,['Pitch']=3.141767,['Y']=31984,['SizeZ']=672.982456,['SizeY']=672.982456,['SizeX']=1870,['EffectType']=847,['Groups']=0,['Id']=4288,['Yaw']=5.553638,['Color']=797979,['X']=75643,['Z']=74501,['Contrast']=1,['MetaData']={['pattern scale % (x)']=150,['pattern scale % (y)']=150,},['Alpha']=1,},[2]={['Roll']=0,['Pitch']=3.141767,['Y']=32126,['SizeZ']=472.982456,['SizeY']=472.982456,