4403,['SizeY']=40,['Id']=1101,['Pitch']=0,['SizeX']=300,['Y']=29745,['Contrast']=1,['Alpha']=1,['SizeZ']=40,['MetaData']={['message']='Pride and Penance',},['Yaw']=3.839724,['X']=61157,},[8]={['Roll']=0,['Groups']=0,['Z']=56254,['Color']=999999,['EffectType']=4402,['SizeY']=40,['Id']=1102,['Pitch']=0,['SizeX']=480,['Y']=29801,['Contrast']=1,['Alpha']=1,['SizeZ']=40,['MetaData']={['message']='If the portal does not work for any reason, please go to my Coldharbor Island.',},['Yaw']=5.410521,['X']=60969,},[9]={['Roll']=0,['Groups']=0,['Z']=59775,['Color']=554119,['EffectType']=8502,['SizeY']=30,['Id']=1103,['Pitch']=5.201081,['SizeX']=26.456456,['Y']=30085,['Contrast']=2.160000,['Alpha']=0.590000,['SizeZ']=30,['MetaData']={['title']='Pride and Penance',['message']='Once upon a time there was a woman who was so full of herself, that she had to look into any mirror she passed just to adore her looks and make sure she was still as beautiful as always. As the years went by and the women got older and older, it took her longer and longer to see herself in the reflection for the face that looked back was a hideous grimace, but not the adorable being she once was. One day the grimace offered her the opportunity to keep her youthful appearance forever. All she really had to do was to live on a huge estate. Blinded by the promise, she didn\\'t even give a second thought and agreed, without having any idea what the grimace wanted her to do realy on her side of the bargain. She also did not ask for the name of her \"benefactor\" - happy that it was up and gone after the pact was closed. This realm was created for her alone, and perhaps one day, when her pride is gone, repentance will be made for her vanity. \\n\\nLet\\'s see what the Eternal Ball has in store for her.',},['Yaw']=3.839724,['X']=63583,},[10]={['Roll']=0,['Groups']=0,['Z']=64588,['Color']=509099,['EffectType']=4500,['SizeY']=600,['Id']=1107,['Pitch']=0,['SizeX']=600,['Y']=31314,['Contrast']=1,['Alpha']=1,['SizeZ']=6